import React from 'react';
// import Chart from 'chart.js';

const Chart = props => {
  const data = props.resp;
  const dataRev = data.reverse();
  // console.log(dataRev);
  // dataRev.map(t => {
  //   // console.log(t);
  // });

  const chartHosp = () =>
    dataRev.filter((res, idx) => {
      return res.postitive;
    });

  console.log(chartHosp);

  return <h1> Hello there</h1>;
};

export default Chart;
